import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      name: {firstName: 'Comfort', lastName: 'Mbeng'}
    }
  }

  render() {
return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
         Hi {this.state.name.firstName} {this.name.lastName}
        </p>
        <button onClick={() => {
          this.setState({ name: {firstName: 'Estelle', lastName: 'Nguty'}});

          }}>Change Name</button>
      </header>
    </div>
  );
  } 
}

export default App;
